import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import {Auth} from './App';

import GlobalStyles from './Components/GlobalStyles';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <GlobalStyles>
      <App />
      <Auth />
    </GlobalStyles>
  </React.StrictMode>
);
